import logo from './../logo.svg';

export default function Item(props){

    return (
      <div className="App-item">
        <img src={props.logo} className="App-item-image" alt="image" />
        <p>{props.name}</p>
        <small>{props.isAvailable ? props.price : ""}</small>
        <small>{props.isAvailable && props.price}</small>
      </div>
    )
}
